import React, { useState } from 'react';
import { View, Image, ImageBackground, Text } from 'react-native';
import { RectButton, ScrollView, TextInput } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';

import styles from './estilo';
import styleGeral from '../../estiloGeral/style';

export default function tCadastrarInfoC() {
  const [nome, setNome] = useState('');
  const [sobrenome, setSobrenome] = useState('');
  const [cpf, setCPF] = useState('');
  const [sexo, setSexo] = useState('');
  const [celular, setCelular] = useState('');
  const [email, setEmail] = useState('');
  const [senha, setSenha] = useState('');
  const [preco, setPreco] = useState('');
  const [link, setLink] = useState('');
  const [dataNascimento, setDataNascimento] = useState('');

  const [dia, setDia] = useState('');
  const [mes, setMes] = useState('');
  const [ano, setAno] = useState('');

  const navigation = useNavigation();

  function formatarData() {
    const dataFormatada = `${ano}-${mes}-${dia}T00:00:00`;
    setDataNascimento(dataFormatada);
  }

  function Voltar() {
    navigation.goBack();
  }

  function avancar() {
    formatarData();
    navigation.navigate('tCadastroLocalC', {
      nome,
      sobrenome,
      celular,
      cpf,
      email,
      senha,
      preco,
      link,
      sexo,
      data_de_nasc: dataNascimento,
    });
  }

  return (
    <ImageBackground style={styleGeral.container}>
      <View style={styles.marginTop}>
        <Image
          style={{ width: 100, height: 109, marginTop: -30 }}
          source={require('../../../assets/logo.png')}
        />
      </View>

      <View>
        <Text style={styles.title}>Cadastro Cuidador</Text>
      </View>

      <ScrollView>
        <View style={styles.footer}>
          <TextInput
            style={styles.input}
            placeholder="Nome"
            value={nome}
            onChangeText={(texto) => setNome(texto)}
          />

          <TextInput
            style={styles.input}
            placeholder="Sobrenome"
            value={sobrenome}
            onChangeText={(texto) => setSobrenome(texto)}
          />

          <TextInput
            style={styles.input}
            placeholder="Sexo"
            value={sexo}
            onChangeText={(texto) => setSexo(texto)}
          />

          <View style={styles.dataContainer}>
            <TextInput
              style={styles.input_nasc}
              placeholder="Dia"
              value={dia}
              onChangeText={(texto) => setDia(texto)}
            />

            <TextInput
              style={styles.input_nasc}
              placeholder="M√™s"
              value={mes}
              onChangeText={(texto) => setMes(texto)}
            />

            <TextInput
              style={styles.input_nasc}
              placeholder="Ano"
              value={ano}
              onChangeText={(texto) => setAno(texto)}
            />
          </View>

          <TextInput
            style={styles.input}
            placeholder="Celular"
            value={celular}
            onChangeText={(texto) => setCelular(texto)}
          />

          <TextInput
            style={styles.input}
            placeholder="CPF"
            value={cpf}
            onChangeText={(texto) => setCPF(texto)}
          />

          <TextInput
            style={styles.input}
            placeholder="E-mail"
            value={email}
            onChangeText={(texto) => setEmail(texto)}
          />

          <TextInput
            style={styles.input}
            placeholder="Senha"
            value={senha}
            onChangeText={(texto) => setSenha(texto)}
          />

          <TextInput
            style={styles.input}
            placeholder="Pre√ßo"
            value={preco}
            onChangeText={(texto) => setPreco(texto)}
          />

          <TextInput
            style={styles.input}
            placeholder="Link"
            value={link}
            onChangeText={(texto) => setLink(texto)}
          />
        </View>
      </ScrollView>

      <View>
        <RectButton style={styles.buttonNext} onPress={avancar}>
          <Text style={styles.buttonText}>Avan√ßar</Text>
        </RectButton>

        <RectButton style={styles.buttonReturn} onPress={Voltar}>
          <Text style={styles.buttonText}>Voltar</Text>
        </RectButton>
      </View>
    </ImageBackground>
  );
}
